import React from "react";
import {connect} from "react-redux";

const WidgetList = ({widgets = []}) =>
<div>
  <h3>Widgets</h3>
  <ul>
    {
      alert(widgets) &&
      widgets.map(widget =>
      <li key ={widget.id}>
        {widget.name} |
        {widget.type} |
        {alert("hi")}
      </li>)
    }
  </ul>
</div>

const stateToPropMapper = (state) => ({
  widgets: state.widgetReducer.widgets
})

export default connect(stateToPropMapper)(WidgetList)
